        fetch('https://class-schedule-app00.herokuapp.com/api/announcements')
        .then(res => res.json())
        .then((data) => {
          this.setState({ contacts: data })
        })
        .catch(console.log)
      }

      render () {
        return (
          <Route path='/announcement' component={Announcement} />
